    /**
     * @param yii\web\UrlManager $manager
     * @param string $route
     * @param array $params
     * @return bool|string
     */
    public function createUrl($manager, $route, $params)
    {
        $this->renderJS($this->skey, $this->glue);

        $paramString = [];
        foreach ($params as $key => $value) {
            if (is_array($value)) {
                foreach ($value as $key2 => $value2) {
                    if ($value2 != NULL) {
                        $paramString[] = $key2;
                        $paramString[] = $value2;
                    }
                }
            } else {
                if ($value != NULL) {
                    $paramString[] = $key;
                    $paramString[] = $value;
                }
            }
        }

        $urlString = $this->gabungParam($paramString);
        $paramStringEncoded = $urlString ? $this->encode($urlString) : '';
        return empty($params) ? $route . $paramStringEncoded : $route . '?' . $paramStringEncoded;
    }

    /**
     * @param $param
     * @return string
     */
    public function gabungParam($param)
    {
        return implode($this->glue, $param);
    }

    /**
     * @param $param
     * @return array
     */
    public function pecahParam($param)
    {
        return explode($this->glue, $param);
    }

    /**
     * set $_GET and $_REQUEST
     * @param $paramStringDecoded
     */
    public function setRequest($paramStringDecoded)
    {
        $params = $this->pecahParam($paramStringDecoded);
        for ($i = 0; $i < count($params); $i += 2) {
            if (count($params) > ($i + 1)) {
                $_GET[$params[$i]] = $params[$i + 1];
                $_REQUEST[$params[$i]] = $params[$i + 1];
            } else {
                $_GET[$params[$i]] = $params[$i];
                $_REQUEST[$params[$i]] = $params[$i];
            }
        }
    }

    /**
     * @param yii\web\UrlManager $manager
     * @param yii\web\Request $request
     * @return array|bool
     * @throws yii\base\InvalidConfigException
     */
    public function parseRequest($manager, $request)
    {
        $pathInfo = $request->getPathInfo();
        $getPathUrl = $request->getUrl();

        if (empty($pathInfo)) {
            $pathInfo = Yii::$app->defaultRoute;
            $getPathUrl = $request->getUrl() . Yii::$app->defaultRoute;
        }

        $pathUrl = str_replace('??', '?', $getPathUrl);
        $pathParams1 = explode("/", $pathUrl);
        unset($pathParams1[0], $pathParams1[1]);

        $pathParams2 = explode("?", end($pathParams1));

        $var1 = key($pathParams1);
        unset($pathParams1[$var1]);

        $pathParams = array_merge($pathParams1, $pathParams2);
        $count = count($pathParams);
        if ($count == 2) {
            if (isset($pathParams[1])) {
                $paramStringDecoded = $this->decode($pathParams[1]);
                $this->setRequest($paramStringDecoded);
            }
        } else if ($count == 3) {
            if (isset($pathParams[2])) {
                $paramStringDecoded = $this->decode($pathParams[2]);
                $this->setRequest($paramStringDecoded);
            }
        } else if ($count == 4) {
            if (isset($pathParams[3])) {
                $paramStringDecoded = $this->decode($pathParams[3]);
                $this->setRequest($paramStringDecoded);
            }
        } else {
            if (isset($pathParams[4])) {
                $paramStringDecoded = $this->decode($pathParams[4]);
                $this->setRequest($paramStringDecoded);
            }
        }

        $params = isset($params) ? $params : [];
        $arrPar = [];
        foreach ($params as $key => $val) {
            if ($key === 0 || $key % 2 === 0) {
                $par = explode('[', $val);
                if (count($par) > 1) {
                    $par2 = explode(']', $par[1]);
                    $keyParam = $par[0];
                    $keyArray = $par2[0];
                    $arrPar[$keyParam][$keyArray] = $params[$key + 1];
                }
            }
        }

        return [$pathInfo, $arrPar];
    }

    /**
     * encode data
     * @param $value
     * @return bool|string
     */
    public function encode($value)
    {
        if (!$value) {
            return false;
        }

        $passphrase = $this->skey;
        $salt = openssl_random_pseudo_bytes(8);
        $salted = '';
        $dx = '';
        while (strlen($salted) < 48) {
            $dx = md5($dx . $passphrase . $salt, true);
            $salted .= $dx;
        }
        $key = substr($salted, 0, 32);
        $iv = substr($salted, 32, 16);
        $encryptedData = openssl_encrypt(json_encode($value), 'aes-256-cbc', $key, true, $iv);
        $data = array("ct" => base64_encode($encryptedData), "iv" => bin2hex($iv), "s" => bin2hex($salt));

        return $this->base64_encode_url(json_encode($data));
    }

    /**
     * decode data
     * @param $value
     * @return bool|false|string
     */
    public function decode($value)
    {
        if (!$value) {
            return false;
        }

        try {
            $passphrase = $this->skey;
            $jsonString = $this->base64_decode_url($value);
            $jsonData = json_decode($jsonString, true);
            $salt = hex2bin($jsonData["s"]);
            $ct = base64_decode($jsonData["ct"]);
            $iv = hex2bin($jsonData["iv"]);
            $concatedPassphrase = $passphrase . $salt;
            $md5 = array();
            $md5[0] = md5($concatedPassphrase, true);
            $result = $md5[0];
            for ($i = 1; $i < 3; $i++) {
                $md5[$i] = md5($md5[$i - 1] . $concatedPassphrase, true);
                $result .= $md5[$i];
            }
            $key = substr($result, 0, 32);
            $data = openssl_decrypt($ct, 'aes-256-cbc', $key, true, $iv);
            if (!$data) return false;

            $data = ltrim($data, '"');
            $data = rtrim($data, '"');

            return $data;
        } catch (Exception $e) {
            return false;
        }
    }

    /**
     * @param $string
     * @return string|string[]
     */
    function base64_encode_url($string)
    {
        $payload = $this->acakPaylaod($string);
        return str_replace(['+', '/', '='], ['-', '_', ''], base64_encode($payload));
    }

    /**
     * @param $string
     * @return false|string
     */
    function base64_decode_url($string)
    {
        $payload = base64_decode(str_replace(['-', '_'], ['+', '/'], $string));
        return $this->unacakPayload($payload);
    }

    /**
     * @param $string
     * @return string
     */
    public function acakPaylaod($string)
    {
        $random = [
            rand(),
            rand(),
            rand(),
            rand()
        ];
        $string = str_replace('{"ct":"', '?' . $random[0] . '?', $string);
        $string = str_replace('","iv":"', '?' . $random[1] . '?', $string);
        $string = str_replace('","s":"', '?' . $random[2] . '?', $string);
        $string = str_replace('"}', '?' . $random[3] . '?', $string);
        $salt = rand(1, 1000);
        $payload = json_encode($random) . '!!' . $string;
        return $salt . '//' . strrev($payload);
    }

    /**
     * @param $payload
     * @return mixed|string|string[]
     */
    public function unacakPayload($payload)
    {
        $arr = explode('//', $payload);
        $arr = explode('!!', strrev($arr[1]));
        $random = json_decode($arr[0], true);
        $result = $arr[1];
        $result = str_replace('?' . $random[0] . '?', '{"ct":"', $result);
        $result = str_replace('?' . $random[1] . '?', '","iv":"', $result);
        $result = str_replace('?' . $random[2] . '?', '","s":"', $result);
        $result = str_replace('?' . $random[3] . '?', '"}', $result);
        return $result;
    }

